import React, { useEffect, useState } from 'react'

function App() {

  const [backendData, setBackendData] = useState([{}])

  useEffect (() => {
    fetch("/user/all").then(
      response => response.json()
    ).then(
      data => {
        setBackendData(data)
      }
    )
  }, [])

  const getBusRoutes = () => {
    fetch("/bus-routes/all").then(
      response => response.json()
    ).then(
      data => {
        setBackendData(data)
      }
    )
  }

  console.log(backendData)
  return (
    <div className="App">
      <button>
        Get Bus Routes
      </button>
      {backendData.map((data) => 
        <div>
          {data.name}
        </div>
      )}
    </div>
  );
}

export default App;
